import dynamic from 'next/dynamic'
const ProductComp = dynamic(() => import('../../../components/product/product.component'));
const Head = dynamic(() =>import('../../../components/head.component'));
const Header = dynamic(() =>import('../../../components/header.component'));
const Footer = dynamic(() => import('../../../components/footer.component'));

const ProductOpen = () => {
    return(
        <>
        <Head/>
        <main className="container-fluid">
            <Header/>
            <ProductComp/>
            <Footer/>
        </main>
        </>
    )
}
export default ProductOpen;
